    false,nt"url": null,nt"notes": "This report contains locations and water
    use at Ouray NWR for 2010. The document begins with a summary of water rights concerning
    Ouray NWR, followed by a brief description of operations and conditions for the
    year. Water use for each feature were then discussed in detail before providing
    tabulated data portraying the total water uses for each feature, the water sources
    that were used, and the pump use. Calculations for total AF use for each feature
    sub unit are calculated and tabulated. Hatchery water use report/management plan
    is now included as part of the water use document, providing more detailed information
